import React from "react"
import '../assets/css/Header.css';

import Navbar from 'react-bootstrap/Navbar'
import Nav from 'react-bootstrap/Nav'
import Fade from 'react-reveal/Fade';
import {Switch, Route, Link, Redirect} from "react-router-dom";

import Dashboard from './Dashboard'
import Preguntas from './Preguntas'
import NotFoundView from './NotFound'

function notFound(){
  return(
    <Fade>
      <NotFoundView/>
    </Fade>
  )
}

const dashboard_view = (
  <div>
    <Fade>
      <Dashboard/>
    </Fade>
  </div>
)

class Header extends React.Component{
  constructor(props) {
    super(props)
    this.navExpanded=false;
  }

  setNavExpanded(expanded) {
     this.setState({ navExpanded: expanded });
  }

  closeNav() {
    this.setState({ navExpanded: false });
  }

  render(){
    return(
      <div id="inicio">
         <Navbar onToggle={this.setNavExpanded(true)}  expanded={this.navExpanded} expand="lg" bg="dark" variant="dark" fixed="top">
           <Navbar.Brand as={Link} to='/'>Testtry</Navbar.Brand>
           <Navbar.Toggle aria-controls="responsive-navbar-nav" />
           <Navbar.Collapse id="responsive-navbar-nav">
             <Nav className="mr-auto">
               <Nav.Link as={Link} to='/Preguntas'>Preguntas</Nav.Link>
               <Nav.Link as={Link} to='/404'>404</Nav.Link>
             </Nav>
           </Navbar.Collapse>
         </Navbar>

         <Switch>
           <Route exact path="/"> {dashboard_view}</Route>
           <Route path="/Preguntas"> <Fade> <Preguntas/> </Fade></Route>
           <Route path="/404" component={notFound}/>
           <Redirect to="/404" />
        </Switch>
       </div>
    )
  }

}


export default Header
